import React, { Component } from 'react';
import { useNavigate } from "react-router-dom";
import './dop/dop.css';
/*import { BrowserRouter as Router, Routes, Route } from "react-router-dom";*/
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

  const Dop = (props) => {
    const navigate = useNavigate(); 
    return (
      <div className='dp'>
        <div className='navigation'>

        </div>

        <div className='logo'>
            <a className='remove' href="https://ellipsis.co.tz"><h1><span className='neno'>DOP</span><span><img className='nembo' src="./images/Ellipsis logo 2.png"/></span><span className='e'>E</span></h1></a>
        </div>
        <div>

                    <Container>
                      <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
                      <Navbar.Toggle aria-controls="basic-navbar-nav" />
                      <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="me-auto">
                          <Nav.Link href="#home">Home</Nav.Link>
                          <Nav.Link href="#link">Link</Nav.Link>
                          <NavDropdown title="Dropdown" id="basic-nav-dropdown">
                            <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                            <NavDropdown.Item href="#action/3.2">
                              Another action
                            </NavDropdown.Item>
                            <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                            <NavDropdown.Divider />
                            <NavDropdown.Item href="#action/3.4">
                              Separated link
                            </NavDropdown.Item>
                          </NavDropdown>
                        </Nav>
                      </Navbar.Collapse>
                    </Container>
              
                );
              }
      </div>


        <div className='dope'>
            <p className='para'><strong className='dev'>Developers </strong><br /><strong className='reach'>Outreach Program </strong><br /><span className='code'>The Best Coding Training Program In</span><br /><span className='tz'>Tanzania</span></p>
      
            <div className='an'>
                <button className='btn3' onClick={() => navigate("/Form")}>APPLY NOW!</button>
            </div>
            
          </div>
      </div>
       
     
    )
  
  }
 
export default Dop;
